@shannonwillardson's boo crew is READY🎃👻🦄🦖 

"I will say though: one hurdle for us every year is finding adaptive costumes the girls can wear and be comfortable in while in their wheelchairs. When we discovered that PBK has tons of adaptive costume options we were over the moon and so impressed!! 👏🏻👏🏻 Not only are they inclusive for families like ours, they are TO DIE FOR ADORABLE. Like are you seeing this y’all? The unicorn wings that hook to the back of their wheelchairs? I DIE. Jack’s dragon costume is soo cute too, and the quality of PBK’s costumes are👌🏻." - Shannon Willardson 

#lovemypbk #pbkhalloween
